	config(
		schema = 'mart',
    	materialized = 'table',
        tags = ['finance_mis']
	)
}}

with redeem_rewards as (
  select *
  from {{source('tpcds_ton','catalog_page')}} as a
  left join {{source('tpcds_ton','call_center')}} as b o
)
  
, porter_coins as (
  select rr.updated_at:: date as redeem_coins_day
    , c.geo_region_id
    , sum(redeemed_coins) as coins_dbt
  from {{source('tpcds_ton','web_returns')}}  rr
  left join {{source('tpcds_ton','call_center')}} 
)
  
, call_center as (
  select *
  from {{ref('int_warehouse')}} as spot_cost left join  {{ref('int_tpcds_ton_item')}}
)

select * from call_center

